sys_variable_value.value:
(function execute(inputs, outputs) {
 try { 
 var r = new sn_ws.RESTMessageV2('x_325709_terraform.WF Replace AWS NAT gateway', 'sn_natgw_replace');
 r.setStringParameterNoEscape('aws_account_name', inputs.aws_account_name);
 r.setStringParameterNoEscape('aws_region', inputs.aws_region);
 r.setStringParameterNoEscape('vpc_id', inputs.vpc_id);
 r.setStringParameterNoEscape('aviatrix_spoke_gw_name', inputs.aviatrix_spoke_gw_name);
 r.setStringParameterNoEscape('aviatrix_spoke_gw_size', inputs.aviatrix_spoke_gw_size);
 r.setStringParameterNoEscape('public_subnet_cidr_gw', inputs.public_subnet_cidr_gw);
 r.setStringParameterNoEscape('public_subnet_cidr_hagw', inputs.public_subnet_cidr_hagw);
 r.setStringParameterNoEscape('aviatrix_network_domain', inputs.aviatrix_network_domain);
 r.setStringParameterNoEscape('allocation_ids_of_whitelisted_ips', inputs.allocation_ids_of_whitelisted_ips);
 r.setStringParameterNoEscape('nat_gw_tag', inputs.nat_gw_tag);
 r.setStringParameterNoEscape('sn_callback_url', inputs.sn_callback_url);
 r.setStringParameterNoEscape('sn_sys_id', inputs.sn_sys_id);

//override authentication profile 
//authentication type ='basic'/ 'oauth2'
//r.setAuthenticationProfile(authentication type, profile name);

//set a MID server name if one wants to run the message on MID
//r.setMIDServer('MY_MID_SERVER');

//if the message is configured to communicate through ECC queue, either
//by setting a MID server or calling executeAsync, one needs to set skip_sensor
//to true. Otherwise, one may get an intermittent error that the response body is null
//r.setEccParameter('skip_sensor', true);

 var response = r.execute();
 outputs.responsebody = response.getBody();
 var httpStatus = response.getStatusCode();
}
catch(ex) {
 var message = ex.message;
}
})(inputs, outputs);

